import logo from './logo.svg';
import './App.css';
import PostList from './postList';
import Form from './Form';


function App() {
  const jeevan = "jeevan"
  return (
    <div className="App">
      <header className="App-header">
        <Form />
        <PostList name={jeevan}/>

      </header>
    </div>
  );
}

export default App;
